import React from "react";
import axios from 'axios';
import { Form , FloatingLabel ,Button} from 'react-bootstrap';



const Signup = () => {

    const [email, setEmail] = React.useState(null);
    const [userName, setUserName] = React.useState(null);
    const [userPass, setUserPass] = React.useState(null);
    
    const onChangetitle = (event) => {
      setNewItem(event.target.value);
    }
    const onChangeContent = (event) => {
        setNewContent(event.target.value);
    }
    const onCreate = (event) => {
        event.preventDefault();
        onItemCreate(newItem, newContent);
        setNewItem('');
    };

    const onClick = (event) => {
      setEmail();
      setUserName();
      setUserPass();
    }

    return (
        <>
        Sign Up
        <Form onSubmit={onCreate}>
            <FloatingLabel
            controlId="floatingInput"
            label="Email address"
            className="mb-3"
            >
            <Form.Control type="email" placeholder="name@example.com" value={email}/>
            </FloatingLabel>
            <FloatingLabel controlId="floatingInput" label="UserName">
            <Form.Control type="text" placeholder="UserName"  value={userName} />
            </FloatingLabel>
            <FloatingLabel controlId="floatingPassword" label="Password">
            <Form.Control type="password" placeholder="Password"  value={userPass} />
            </FloatingLabel>
            <Button onClick={onClick}>
                Sign In
            </Button>
        </Form>
      </>
    );

}

export default Signup;
